Now available in English! Order via Etsy (link in BIO). Tutorial on making beadwoven brooch with Swarovski crystals and Czech beads - ZoliDuo and Spikes. Includes instructions how to make leather backside. Includes list of supplies, step-by-step photos and instructions. 14 pages. Size of finished brooch is 4 cm.
