‚Ä¢ TOHO seed beads 15/0, color 711 (nickel);
‚Ä¢ Japanese pin for brooch 30 mm with 2 holes;
‚Ä¢ Beading needle Pony #12;
‚Ä¢ Threads (I use Madeira MonoÔ¨Ål #60 folded twice);
